import React, { Component } from 'react';
import Logo from '../hoc/Logo';
import './style.scss';
import {
  Segment,
  Button,
  Icon,
  Card,
  Container,
  Image
} from 'semantic-ui-react';

class Home extends Component {
  render() {
    return (
      <React.Fragment>
        <div className="cont">
          <div className="divcont">
            <h1>
              <Logo size={40} />
            </h1>
            <p>Monitor all your nephews easily</p>
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default Home;
